import React from 'react';
import s from './Dialog.module.css'
import NameDialog from './NameDialog/NameDialog'
const Dialog = () =>{
    return (
       <div>
           <div className={s.Dialog_container}>
        <NameDialog />
           <div className={s.text_dialog}>
               <div>dialoitem</div>
               <div>dialoitem</div>
               <div>dialoitem</div>
               <div>dialoitem</div>
               <div>dialoitem</div>
               <div>dialoitem</div>
           </div>
           </div>
       </div>
    );
}
export default Dialog;
